/// judgment_download : ""
/// judgment_name : "WP10-19-09-09-2019.pdf"
/// status : 1
/// msg : ""

class JudgmentDownloadModel {
  JudgmentDownloadModel({
      this.judgmentDownload, 
      this.judgmentName, 
      this.status, 
      this.msg,});

  JudgmentDownloadModel.fromJson(dynamic json) {
    judgmentDownload = json['judgment_download'];
    judgmentName = json['judgment_name'];
    status = json['status'];
    msg = json['msg'];
  }
  String judgmentDownload;
  String judgmentName;
  int status;
  String msg;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['judgment_download'] = judgmentDownload;
    map['judgment_name'] = judgmentName;
    map['status'] = status;
    map['msg'] = msg;
    return map;
  }

}